import { Calendario } from "./style";

interface tipoDeDados {
  dias : object;
}

const Message = new React.Component({
  render(): JSX.Element {
    return (
      <div>oi</div>
    );
  }
});

function Card({ dias }: tipoDeDados) {
  return (
    <>
      <Calendario>
        <Message></Message>
      </Calendario>
    </>
  );


}

export default Card;
